import React from "react";
import "../css/App.css";

class Form extends React.Component {
  render() {
    return (
      <div class="ui middle aligned center aligned grid">
        <div class="column">
          <h2 class="ui image header">Test</h2>
          <form class="ui large form" />
        </div>
      </div>
    );
  }
}

export default Form;
